import React from 'react'

interface Option {
    id: number;
    content: string;
    correct: boolean;
}
interface Props{
    options: Option[] | undefined;
}
export default function Options(props: Props){
  return (
    <>
        {props.options?.map(option=>
            <div className='p-1 bg-blue-300 my-1  rounded-lg ' key={option.id}>{option.content}</div>
        )}
    </>
  )
}
